import React from 'react'

export default function Header() {
  return (
    <header style={{
      textAlign: 'center'
    }}>
      <h1 style={{
        padding: '20px 0',
        background: '#fff',
        width: '70%',
        margin: 'auto'
      }}>О-комплекс</h1>
    </header>
  )
}
